import React from 'react';
import s from './Header.module.css';
import Logo from '../../img/logo.png'

const Header = () => {
	return(
    <header>
   		<a href="/">
   			<img src={Logo} alt="Football statistics" />
   		</a>
   		<div id="title"><h1>ФУТБОЛЬНАЯ СТАТИСТИКА</h1></div>
    </header>
    )
}

export default Header;
